(1, 2, '6', 'Monte Verita - East Tower', '<p>A Re-Development project in a MHADA layout at Magathane. The scheme has been designed as a premium Residential project in this residential neighbourhood of Magathane at Borivali. The design scheme has 2 towers of 22 storeys high (70 M) having 6 flats per flr. - well-designed, cross-ventilated airy flats with good natural light and ventilation. The scheme has 1,1.5, &amp; 2 BHK flats.Multi-Level Podium parking takes care of the parking needs with a Garden on the Podium top. Clubhouse, Pergola covered Recreation area, Children&rsquo;s play area etc. form part of the amenities.</p>\r\n', '21a0e2494a0c2b06619fbf615c8d72b8_2.webp', 'http://www.viveknandan.com/uploads/product/21a0e2494a0c2b06619fbf615c8d72b8_2.webp', 1, '', '', '6c9a936cfa734cad6b441435e0d3c320_2.webp', 'http://www.viveknandan.com/uploads/product/6c9a936cfa734cad6b441435e0d3c320_2.webp', 1, 1, 1, '2024-03-22 23:13:14', '', '', '', '', '', '', '', 'monte-verita-east-tower', 'Monte Verita - East Tower', 'Magathane, Borivali', 'BGSCTPL', '66.60 Crores', '1', '2,22,000 sq.ft.'),
(2, 2, '6', 'Monte Verita - West Tower', '<p>A Re-Development project in a MHADA layout at Magathane. The scheme has been designed as a premium Residential project in this residential neighbourhood of Magathane at Borivali. The design scheme has 2 towers of 22 storeys high (70 M) having 6 &amp; 5 flats per flr. Well-designed, cross-ventilated airy flats with good natural light and ventilation. The scheme has 1,1.5, &amp; 2 BHK flats.Multi-Level Podium parking takes care of the parking needs with a Garden on the Podium top. Clubhouse, Pergola covered Recreation area, Children&rsquo;s play area etc. form part of the amenities.</p>\r\n', '2418c02cc871af379392ca8ee2149306_2.webp', 'http://www.viveknandan.com/uploads/product/2418c02cc871af379392ca8ee2149306_2.webp', 2, '', '', 'b671007bcfdae90dc8404c87b41022cb_2.webp', 'http://www.viveknandan.com/uploads/product/b671007bcfdae90dc8404c87b41022cb_2.webp', 1, 1, 1, '2024-03-22 23:20:48', '', '', '', '', '', '', '', 'monte-verita-west-tower', 'The Roost  Rice University Student Center Design ', 'Magathane, Borivali', 'BGSCTPL', '67.50 Crores', '2', '2,25,000 sq.ft.'),
(3, 2, '6', 'Monte Verita - North Annexe', '<p>A Re-Development project in a MHADA layout at Magathane. The scheme has been designed as an Aspirational Residential project in this residential neighbourhood of Magathaneat Borivali. The design scheme has 2 towers of 22 storeys high (70 M) having56 and 4 flats per flr. - well-designed, cross-ventilated airy flats with good natural light and ventilation. Scheme has 1 &amp; 2 BHK flats. 3-level Stack-Parking and parking tower take care of the parking needs. Garden, Clubhouse, Childrens play area etc. form part of the amenities.</p>\r\n', '59b846bafd26ee68ca14ed78406f91b0_2.webp', 'http://www.viveknandan.com/uploads/product/59b846bafd26ee68ca14ed78406f91b0_2.webp', 3, '', '', '1a666f3c6f7b81657c91a3edf09f2ca7_2.webp', 'https://digihostsolutions.com/vivek-nandan-live/uploads/product/1a666f3c6f7b81657c91a3edf09f2ca7_2.webp', 1, 1, 1, '2024-03-22 23:21:54', '', '', '', '', '', '', '', 'monte-verita-north-annexe', 'Monte Verita - North Annex', 'Magathane, Borivali', 'BGSCTPL', ' 46.50 Crores', '4', ' 1,55,000 sq.ft.'),
(4, 1, '', 'Teenmurti Summit', '<p>A Re-Development project in a MHADA layout at Magathane. The scheme has been designed as a premium Residential project in this residential neighbourhood of Magathane at Borivali. The design scheme has 2 towers of 23 storeys high (70 M) having 6 and 4 flats per flr. - well-designed, cross-ventilated airy flats with good natural light and ventilation. The scheme has 1,1.5, 2 &amp; 2.5 BHK flats.Two Car parking towers take care of the parking needs. Garden, Clubhouse, Childrens play area etc. form part of the amenities.</p>\r\n', '149bb8c006d29509119ce522b5f4ddb2_2.webp', 'http://www.viveknandan.com/uploads/product/149bb8c006d29509119ce522b5f4ddb2_2.webp', 4, '', '', '2c2f429110f4db0b378946ad3534c94d_2.webp', 'https://digihostsolutions.com/vivek-nandan-live/uploads/product/2c2f429110f4db0b378946ad3534c94d_2.webp', 1, 1, 1, '2024-03-22 23:22:49', '', '', '', '', '', '', '', 'teenmurti-summit', 'Teenmurti Summit', 'Magathane, Borivali', 'BGSCTPL', '63 Crores', '5', '2,10,000 sq.ft.'),
(8, 5, '', 'Sangita Ellipse', '<p>A dynamic commercial cum office building comprising of a double height stilt + 10 upper floors of large, column free commercial spaces. The double height houses a 4 level mechanical car park. The building has modern amenities complete with glass and aluminium cladding, terrace garden etc.</p>\r\n', '', '', 35, '', '', '452eee0aa7de157a45396e2dc41668d2_2.webp', 'https://digihostsolutions.com/vivek-nandan-live/uploads/product/452eee0aa7de157a45396e2dc41668d2_2.webp', 1, 0, 2, '2024-03-05 17:25:19', '', '', '', '', '', '', '', 'sangita-ellipse2', 'Sangita Ellipse', 'Sahakar Rd, Vile Parle', 'Sangita Realty', '7.00 Crores', '', '35,000 sq.ft.'),
(9, 3, '', 'ACME S\'Mall ', '<p>Shopping Mallfor Acme Builders comprising of Lower Grd, Grd + three upper floors complete with Escalators, Capsule Lifts, Central Atrium with skylight etc. to make shopping here a real experience. Has two levels of basement for parking, Food court and banquet hall at third flr. level etc.</p>\r\n', '', '', 10, '', '', 'e941d9ff95710964c201a5dcefe6bd37_2.webp', 'https://digihostsolutions.com/vivek-nandan-live/uploads/product/e941d9ff95710964c201a5dcefe6bd37_2.webp', 1, 1, 2, '2024-03-05 17:42:44', '', '', '', '', '', '', '', 'acme-small-', 'S.V. Rd., Santacruz(W)', 'S.V. Rd., Santacruz(W)', 'Acme Builders', '28 Crores', '', '1,20,000 sq.ft.'),
(10, 3, '', 'Business Point', '<p>A Commercial cum office building for Mr. Bhatukbhai P. Shah comprising of a basement + Ground + five upper floors of Office space replete with modern amenities, with the building fa&ccedil;ade complete with Aluminum and Glass cladding.</p>\r\n', '', '', 11, '', '', '294dbb0b2cc6ad433e0a1254ee8ee9c5_2.webp', 'https://digihostsolutions.com/vivek-nandan-live/uploads/product/294dbb0b2cc6ad433e0a1254ee8ee9c5_2.webp', 1, 1, 2, '2024-03-05 17:46:23', '', '', '', '', '', '', '', 'business-point', 'Bhandup', 'Bhandup', '  Mr. Bhatukbhai P. Shah', '  4.5 Crores', '', '  25,000 sq.ft.'),
(11, 1, '', 'Sangita Aspire', '<p>A SRA scheme having around 36 tenants. Sale has been designed as a premium project in thisresidential neighbourhood of VileParle. A single tower 12 storyed high with 2 well designed, airy flats on each floor-2 BHK units. 3 level mechanical carparks take care of the parkingneeds. Clubhouse, etc. form part of the amenities.</p>\r\n', '', '', 13, '', '', '68d9f5742902ec7045dda7222da57732_2.webp', 'https://digihostsolutions.com/vivek-nandan-live/uploads/product/68d9f5742902ec7045dda7222da57732_2.webp', 1, 1, 2, '2024-03-05 17:24:47', '', '', '', '', '', '', '', 'sangita-aspire', 'Sangita Aspire', '  RT Road, Vile Parle', 'Sangita Realty', '8.70 Crores', '', '39,000 sq.ft. '),
(12, 1, '', 'Vireshwar Heights', '<p>A SRA scheme having around 110 tenants. Sale has been designed as a premium project in this residential neighbourhood of Vile Parle. A single tower 12 storyed high with 4 well designed, cross ventilated airy flats on each floor - 2 and 3 BHK with terrace flats/penthouses at the top 3 and 4 level mechanical car parks take care of the parking needs. Garden, clubhouse, childrens play area etc. form part of the amenities.</p>\r\n', '', '', 14, '', '', 'a8dad397c72cf9da9687841754e02def_2.webp', 'https://digihostsolutions.com/vivek-nandan-live/uploads/product/a8dad397c72cf9da9687841754e02def_2.webp', 1, 1, 2, '2024-03-13 18:08:24', '', '', '', '', '', '', '', 'vireshwar-heights', 'Vireshwar Heights', 'Kunkuwadi, Vile Parle', 'Suparshwa Realty', '21 Crores', '', '  1,08,000 sq.ft.'),
(13, 1, '', 'Ohm Sainath CHS', '<p>A Re-development project with a Civil Aviation height limit of 7 floors with minimum 20% garden and parking for 160 cars. Consuming complete FSI Designed as a premium project in this residential neighbourhood of Vile Parle. Three buildings 7 storyed high with well designed, cross ventilated airy flats on each floor - 2 and 3 BHK with terrace flats/penthouses at the top. Stilt parking at ground with double basement for parking. Gymnasium, Kids Zone, Garden, Children&rsquo;s Play area, Jogging Track, Fountains, Designer Entrance halls etc.</p>\r\n', '', '', 15, '', '', '40abf7e18e09438be9fc1dceb16f0804_2.webp', 'http://www.viveknandan.com/uploads/product/40abf7e18e09438be9fc1dceb16f0804_2.webp', 1, 1, 2, '2024-03-14 12:11:20', '', '', '', '', '', '', '', 'ohm-sainath-chs', 'Ohm Sainath CHS', 'S.V. Road, Vile Parle', 'Mehta Group', '32 Crores', '', '1,08,000 sq.ft.'),
(14, 1, '', 'Chandravihar CHS', '<p>A Re-development scheme in a prime residential neighbourhood of Mulund. A single tower 12 storyed high with 4 well designed, cross ventilated airy flats on each floor - 2 and 3 BHK. 3 level mechanical car parks take care of the parking needs. Clubhouse, etc. form part of the amenities.</p>\r\n', '', '', 16, '', '', '2854a8813782718b0620c16ec66560c9_2.webp', 'https://digihostsolutions.com/vivek-nandan-live/uploads/product/2854a8813782718b0620c16ec66560c9_2.webp', 1, 1, 2, '2024-03-05 17:19:55', '', '', '', '', '', '', '', 'chandravihar-chs', 'Chandravihar CHS', 'Mulund', '  Vardhan Reality', '  6 Crores', '', '  28,000 sq.ft.'),
(15, 5, '', 'Assisted Homes', '<p>Conceptual layout for Reliance ADA under the aegis of Harmony - the proposed &ldquo;Assisted Homes&rdquo; is to be developed in a plot area of 10 acres. The development consists of single rooms, suites, penthouses, cottages etc., along with shopping and Recreational facilities, auditoriums, maintenance blocks, activity centers etc. Fountains, swimming pools, decks, amphitheaters, pavilions, clubhouse facilities etc. form an integral part of the planned scheme.</p>\r\n', '', '', 34, '', '', 'a53d5e510e051b94a0caabe70a21f03d_2.webp', 'https://digihostsolutions.com/vivek-nandan-live/uploads/product/a53d5e510e051b94a0caabe70a21f03d_2.webp', 1, 0, 2, '2024-03-07 17:38:31', '', '', '', '', '', '', '', 'assisted-homes2', 'Assisted Homes', '  Jaipur', '  RelianceADA', '  238 Crores', '', '  13,25,000 sq.ft.'),
(16, 1, '', 'Sanghvi Galaxy', '<p>A 33(7) - Cess plot scheme having around 74 tenants. The sale component comprises of one 22 storied residential tower comprising of 2 &amp; 3 BHK flats and Duplexes at the top floor with Grd flr shopping, 4 levels for parking, Podium for Clubhouse, Swimming Pool, Garden, Play Areas etc</p>\r\n', '', '', 18, '', '', 'fc9eadad8f523bcb4dc8a10827cf6428_2.webp', 'https://digihostsolutions.com/vivek-nandan-live/uploads/product/fc9eadad8f523bcb4dc8a10827cf6428_2.webp', 1, 1, 2, '2024-03-05 18:01:53', '', '', '', '', '', '', '', 'sanghvi-galaxy', '  Khetwadi, Girgaon', '  Khetwadi, Girgaon', '  Sanghvi Group Of Companies', '  22 Crores', '', '  1,04,000 sq.ft.'),
(17, 2, '9', '  Sanghvi City', '<p>Aminicity being developed on 13 acres of land having the best of amenities. Project has 1&frac12;,2, 2&frac12; &amp;3BHK well designed cross-ventilated flats in 15 storied towers with landscaped garden spaces app. 40,000sq.ft. In a single piece. Commercial spaces, clubhouse, children&#39;s play area, water bodies, other amenities etc form a crucial part of the planned development.</p>\r\n', '', '', 19, '', '', 'ac948ed70306628479f9783b7f1905ce_2.webp', 'https://digihostsolutions.com/vivek-nandan-live/uploads/product/ac948ed70306628479f9783b7f1905ce_2.webp', 1, 1, 2, '2024-03-05 18:10:46', '', '', '', '', '', '', '', '-sanghvi-city', '  Mira Road', '  Mira Road', '  Sanghvi Group Of Companies', '  136 Crores', '', '  6,20,000 sq.ft.'),
(18, 1, '', 'Krypton Tower', '<p>A 33(7) - Cess plot project with around 93 tenants has a Stilt + Podium + Car parking Lvl. + 20 storeys Residential building as the sale component for Krypton Constructions comprising of two &amp; three BHK flats and Duplexes and Penthouses at higher levels complete with Swimming Pool, Clubhouse etc. at the Terrace lvl.</p>\r\n', '', '', 20, '', '', 'e705d84d8e40da7af472c37934c80be8_2.webp', 'https://digihostsolutions.com/vivek-nandan-live/uploads/product/e705d84d8e40da7af472c37934c80be8_2.webp', 1, 1, 2, '2024-03-05 17:21:59', '', '', '', '', '', '', '', 'krypton-tower', 'Krypton Tower', 'Prabhadevi', 'Krypton Const', '20 Crores', '', '1,15,000 sq.ft.'),
(19, 1, '', 'Krypton Twin Tower', '<p>A 33(7) - Cess plot project having around 108 tenants. Sale consists of two 22 storied towers with Stilt + Podium for Krypton Constructions comprising of one, two &amp; three BHK flats complete with Landscaped gardens, Play areas, Clubhouse, Swimming Pool etc. Also has Commercial / Shopping at Grd. and first flr. Lvl. (Road facing) with 3 Podiums for car parking and 1 Podium for Garden.</p>\r\n', '', '', 21, '', '', 'a154c1b61b42d918afdee1640eb04c3f_2.webp', 'https://digihostsolutions.com/vivek-nandan-live/uploads/product/a154c1b61b42d918afdee1640eb04c3f_2.webp', 1, 1, 2, '2024-03-05 17:22:11', '', '', '', '', '', '', '', 'krypton-twin-tower', 'Krypton Twin Tower', 'Parel - Sewri', 'Krypton Const.', '45 Crores', '', '2,50,000 sq.ft.'),
(20, 1, '', 'Sanghvi Heights', '<p>A SRA project having around 102 tenants. The sale component comprising of one 20- Storied Residential building with Podium complete with Clubhouse, Garden etc. comprising of 2, 3, 4 BHK flats and Penthouses at the upper floors.</p>\r\n', '', '', 22, '', '', 'b9f9bf90b509c9239d4297275cf18719_2.webp', 'https://digihostsolutions.com/vivek-nandan-live/uploads/product/b9f9bf90b509c9239d4297275cf18719_2.webp', 1, 1, 2, '2024-03-05 17:23:56', '', '', '', '', '', '', '', 'sanghvi-heights', 'Wadala', 'Wadala', 'Sanghvi Group Of Companies', '  25 Crores', '', '  1,41,000 sq.ft.'),
(21, 5, '', 'Kinjal Heights', '<p>One15 storied Residential building with Grd.+two upperfloors Commercial/Shopping and two upper levels of parking with a stilt/Podium above it complete with Landscaped gardens, Play areas etc.comprising of 2 and 3BHK two flats per floor.</p>\r\n', '', '', 33, '', '', '4743bbb8bdecd593c477b0bba8340dd9_2.webp', 'https://digihostsolutions.com/vivek-nandan-live/uploads/product/4743bbb8bdecd593c477b0bba8340dd9_2.webp', 1, 0, 2, '2024-03-05 17:21:12', '', '', '', '', '', '', '', 'kinjal-heights', '  Tardeo', 'Tardeo', 'Highrock Const', '14 Crores', '', '75,000 sq.ft. '),
(22, 3, '', 'IT Park', '<p>A JV project between Prime Engineers &amp; Builders and Pankaj Enterprises, a 11 storied IT building with capsule lifts complete with modern amenities viz.Gym, Restaurant etc.finished with Aluminium and Glass Cladding.</p>\r\n', '', '', 24, '', '', '72d7e0faf24131c03ecdd2638c25ec85_2.webp', 'https://digihostsolutions.com/vivek-nandan-live/uploads/product/72d7e0faf24131c03ecdd2638c25ec85_2.webp', 1, 1, 2, '2024-03-05 17:20:41', '', '', '', '', '', '', '', 'it-park', 'IT Park', 'Chandivali', 'Prime Engineers & Builders', '  30 Crores', '', '1,60,000 sq.ft.'),
(23, 1, '', 'Yugdharma Phase II', '<p>With a flamboyant design concept a 35 storied Residential building with Stilts+Podium complete with Landscaped Gardens, Play areas, Swimming Pool, Clubhouse etc. Comprises of 2, 2/12 and 3BHK-six flats per floor.Duplexes and Penthouses at the top floors with Terrace Garden.</p>\r\n', '', '', 25, '', '', '0b695f16fce43fa491c728706b3c1a71_2.webp', 'https://digihostsolutions.com/vivek-nandan-live/uploads/product/0b695f16fce43fa491c728706b3c1a71_2.webp', 1, 1, 2, '2024-03-05 17:27:33', '', '', '', '', '', '', '', 'yugdharma-phase-ii', 'Yugdharma Phase II', 'Malad (W)', 'Kalpataru Const', '43 Crores', '', '1,96,000 sq.ft.'),
(24, 1, '', 'Poseidon', '<p>One Stilt + Seventeen and One Stilt + Seven storied Residential Towers for Vardhan Builders with Podium, Clubhouse, Fountains, Landscaped Gardens, Play areas etc.</p>\r\n', '', '', 26, '', '', '4cf9d892cb6175d5dfca4ac31ac25ed3_2.webp', 'https://digihostsolutions.com/vivek-nandan-live/uploads/product/4cf9d892cb6175d5dfca4ac31ac25ed3_2.webp', 1, 1, 2, '2024-03-05 17:23:18', '', '', '', '', '', '', '', 'poseidon', 'Poseidon', 'Versova, Andheri', 'Vardhan Builders', '18 Crores', '0', '1,25,000 sq.ft.'),
(25, 1, '', 'GoldCrest', '<p>A stilt + seven storied residential building &quot;GoldCrest&quot; comprising of two 2 BHK flats per flr. for M/s Neumec Ventures complete with a Capsule Glass Elevator.</p>\r\n', '', '', 27, '', '', '613af1e7ed38b1c63bdebf10abc078d4_2.webp', 'https://digihostsolutions.com/vivek-nandan-live/uploads/product/613af1e7ed38b1c63bdebf10abc078d4_2.webp', 1, 1, 2, '2024-03-05 17:20:18', '', '', '', '', '', '', '', 'goldcrest', '  Kalina, Santacruz', '  Kalina, Santacruz', 'M/s Neumec Ventures', '1.8 Crores', '', '14,000 sq.ft.'),
(26, 1, '', 'Acme Elite', '<p>A Grd. + 11 storeyed residential building &quot;ACME ELITE&quot; for Acme Builders comprising of two 3 BHK and one 2 BHK flat per floor complete with ground floor shopping, landscaped gardens, play areas etc.</p>\r\n', '', '', 28, '', '', '912cb181c823a8519138229c2858a401_2.webp', 'https://digihostsolutions.com/vivek-nandan-live/uploads/product/912cb181c823a8519138229c2858a401_2.webp', 1, 1, 2, '2024-03-05 17:16:52', '', '', '', '', '', '', '', 'acme-elite', 'Majas, Andheri  ', 'Majas, Andheri  ', 'Acme Builders', '  6 Crores', '', '42,000 sq.ft. '),
(27, 1, '', 'Banganga', '<p>A stilt + eight storeys residential building at Banganga, Mumbai.</p>\r\n', '', '', 29, '', '', '18b64b55b9bdf32f022bdff86b1e60a0_2.webp', 'https://digihostsolutions.com/vivek-nandan-live/uploads/product/18b64b55b9bdf32f022bdff86b1e60a0_2.webp', 1, 1, 2, '2024-03-05 17:19:04', '', '', '', '', '', '', '', 'banganga', 'Banganga', 'Walkeshwar', 'M/s Kaluchand M. Ranka', '  3.00 Crores', '0', '  21,000 sq.ft.'),
(28, 1, '', 'Sangita Nest', '<p>Situated at a very prime residential location in VileParle though in the Aircraft flight funnel,this building with a basement,Grd.+4upperfloors has only 2BHK and 3BHK Duplex flats complete with Curtain Glazing &amp; Stilt parking.</p>\r\n', '', '', 30, '', '', 'a21a36751e95be6ea1c7817638fc0a38_2.webp', 'https://digihostsolutions.com/vivek-nandan-live/uploads/product/a21a36751e95be6ea1c7817638fc0a38_2.webp', 1, 1, 2, '2024-03-05 17:25:36', '', '', '', '', '', '', '', 'sangita-nest', 'Sangita Nest', '  Vile Parle', '  Sangita Realty', '  3.00 Crores', '', '22,000 sq.ft.'),
(29, 1, '', 'Shree Adinath Tower', '<p>A residential building complex of Stilt+Seven storied buildings for Vardhan Construction Company with Clubhouse, Fountains, Landscaped gardens, Play areas, Shops (Commercial) etc.</p>\r\n', '', '', 31, '', '', 'c3297461951b46d9ad9aa23c96603df3_2.webp', 'https://digihostsolutions.com/vivek-nandan-live/uploads/product/c3297461951b46d9ad9aa23c96603df3_2.webp', 1, 1, 2, '2024-03-05 17:26:23', '', '', '', '', '', '', '', 'shree-adinath-tower', '  Borivali (E)', '  Borivali (E)', '  Vardhan Const. Co.', '  13 Crores', '', '  1,17,000 sq.ft.'),
(30, 1, '', 'Residential Complex', '<p>A residential building complex of 5 buildings of 4 &amp; 6 flats on a floor of Stilt + Seven storeys comprising of One and Two Bedroom flats, Landscaped gardens, Play areas etc. for Gowani Builders.</p>\r\n', '', '', 32, '', '', 'a3bc08b07fbd84c99abf898d28b7857e_2.webp', 'https://digihostsolutions.com/vivek-nandan-live/uploads/product/a3bc08b07fbd84c99abf898d28b7857e_2.webp', 1, 1, 2, '2024-03-05 17:23:37', '', '', '', '', '', '', '', 'residential-complex', 'Residential Complex', '  Chickuwadi, Borivali (W)', '  Mr. Kanti Gowani', '  9.5 Crores', '', '  1,05,000 sq.ft.'),
(31, 1, '', 'Sanghvi Villas', '<p>An exclusive Villa/Bungalow Scheme conceptualized on the lines of a Resort Retreat at the pristine hill station of Lonavla about 100Km from Mumbai. The Scheme comprises of 2BHK, 3 BHK and 4 BHKDuplex Villas with open-to-air sitouts, private terraces and expansive private Garden Areas, Fountains, Swimming Pool, Childrens Play Areas, and Landscaped Gardens add to the ambience of the development. The Club set afloat amidst a waterbody adds the coup de lagrace to the whole design solution.</p>\r\n', '', '', 12, '', '', '9ec8354041d91612f3d84158033d266c_2.webp', 'https://digihostsolutions.com/vivek-nandan-live/uploads/product/9ec8354041d91612f3d84158033d266c_2.webp', 1, 1, 2, '2024-03-05 17:59:25', '', '', '', '', '', '', '', 'sanghvi-villas', 'Sanghvi Villas', 'Tungarli, Lonavla', 'Sanghvi Group Of Companies', '9.50 Crores', '', '40,000 sq.ft.'),
(33, 3, '', 'Sangita Ellipse', '<p>A dynamic commercial cum office building comprising of a double height stilt + 10 upper floors of large, column free commercial spaces. The double height houses a 4 level mechanical car park. The building has modern amenities complete with glass and aluminium cladding, terrace garden etc.</p>\r\n', '', '', 9, '', '', '5dd3463036a97ac1899de0b7dd01da36_2.webp', 'https://digihostsolutions.com/vivek-nandan-live/uploads/product/5dd3463036a97ac1899de0b7dd01da36_2.webp', 1, 1, 2, '2024-03-05 17:25:11', '', '', '', '', '', '', '', 'sangita-ellipse', 'Sangita Ellipse', 'Sahakar Rd, Vile Parle', 'Sangita Realty', '7.00 Crores', '0', '35,000 sq.ft.'),
(34, 3, '', 'Kinjal Heights', '<p>One15 storied Residential building with Grd.+two upperfloors Commercial/Shopping and two upper levels of parking with a stilt/Podium above it complete with Landscaped gardens, Play areas etc.comprising of 2 and 3BHK two flats per floor.</p>\r\n', '', '', 23, '', '', '2bb7578b6507efa5a27fabf9e7d31f24_2.webp', 'https://digihostsolutions.com/vivek-nandan-live/uploads/product/2bb7578b6507efa5a27fabf9e7d31f24_2.webp', 1, 1, 2, '2024-03-05 17:21:03', '', '', '', '', '', '', '', 'kinjal-heights2', 'Kinjal Heights', 'Tardeo', 'Highrock Const', '14 Crores', '0', '75,000 sq.ft. '),
(35, 4, '', 'Assisted Homes', '<p>Conceptual layout for Reliance ADA under the aegis of Harmony - the proposed &ldquo;Assisted Homes&rdquo; is to be developed in a plot area of 10 acres. The development consists of single rooms, suites, penthouses, cottages etc., along with shopping and Recreational facilities, auditoriums, maintenance blocks, activity centers etc. Fountains, swimming pools, decks, amphitheaters, pavilions, clubhouse facilities etc. form an integral part of the planned scheme.</p>\r\n', '', '', 17, '', '', 'b1fc46cc7394c38010539b0f927d398a_2.webp', 'https://digihostsolutions.com/vivek-nandan-live/uploads/product/b1fc46cc7394c38010539b0f927d398a_2.webp', 1, 1, 2, '2024-03-07 17:38:09', '', '', '', '', '', '', '', 'assisted-homes', 'Assisted Homes', '  Jaipur', '  RelianceADA', '  238 Crores', '', '  13,25,000 sq.ft.'),
(36, 2, '7', 'Suparshwa Rehab ', '<p>Suparshwa Rehab&nbsp;</p>\r\n', '', '', 36, '', '', '5fbae897b39a1536fd70dd21a7dfaadb_2.webp', 'http://www.viveknandan.com/uploads/product/5fbae897b39a1536fd70dd21a7dfaadb_2.jpg', 1, 0, 2, '2024-03-22 11:40:38', '', '', '', '', '', '', '', 'suparshwa-rehab-', 'Rehab Suparshwa', 'Old Nagardas Rd, Andheri', 'Suparshwa Realty', 'lorem', '0', 'lorem'),
(37, 2, '7', ' Suparshwa Eternia', '<p>A Re development scheme having around 35 tenants. The scheme has been designed as an Affordable Residential project in this residential neighbourhood of Andheri. A single tower 21-storyes high with 5 well-designed, ventilated airy flats on each floor- 1 and 1.5 BHK with Terrace Garden&amp; Clubhouse at the top as amenities. Mechanical parking takes care of the parking needs.<br />\r\n&nbsp;</p>\r\n', '', '', 6, '', '', '81b41a81d6c2262a31d7231377cf26aa_2.webp', 'http://www.viveknandan.com/uploads/product/81b41a81d6c2262a31d7231377cf26aa_2.webp', 1, 1, 2, '2024-03-14 12:10:57', '', '', '', '', '', '', '', '-suparshwa-eternia', ' Suparshwa Eternia', 'Old Nagardas Rd, Andheri', 'Suparshwa Realty', '15 Crores', '', '52,000 sq.ft.'),
(38, 2, '7', 'Suparshwa Urbana', '<p>A SRA-cum-ReDevelopment scheme having around 150 +45 tenants. The schemehas been designed as apremiumResidential projectinthis residential neighbourhood of Andheri. Sale flats are inasingle tower 21-storyes high with 6 well-designed,cross-ventilated airy flats oneach floor- 2 and1BHK with Terrace Garden at the top. Two Car parking towers take care of the parking needs. Garden, Clubhouse, Childrens play area etc. form part of the amenities.</p>\r\n', '64f37680853ce0914c17bb82bac8603a_2.webp', 'http://www.viveknandan.com/uploads/product/64f37680853ce0914c17bb82bac8603a_2.webp', 5, '', '', 'c7c89bc280f48eb84a1265ba402fe747_2.webp', 'http://www.viveknandan.com/uploads/product/c7c89bc280f48eb84a1265ba402fe747_2.webp', 1, 1, 1, '2024-03-22 23:16:43', '', '', '', '', '', '', '', 'suparshwa-urbana', 'Suparshwa Urbana', 'Old Nagardas Rd, Andheri', 'Suparshwa Realty', '85 Crores', '3', '2,85,000 sq.ft.'),
(39, 2, '8', 'SVP Ngr Scheme-02', '<p>A Preliminary Cluster Layout Re-Development scheme for SVP Ngr, at Andheri (W) for SD Corp.</p>\r\n', '', '', 8, '', '', '64aabaa1b2392fd517497b80303c70d4_2.webp', 'https://digihostsolutions.com/vivek-nandan-live/uploads/product/64aabaa1b2392fd517497b80303c70d4_2.webp', 1, 1, 2, '2024-03-05 17:26:05', '', '', '', '', '', '', '', 'svp-ngr-scheme-02', 'SVP Ngr Scheme-02', 'Andheri (W)', 'SD Corp', 'Lorem', '', 'Lorem'),
(40, 2, '8', 'SVP Ngr Scheme-01', '<p>A Preliminary Cluster Layout Re-Development scheme for SVP Ngr, at Andheri (W) for SD Corp.</p>\r\n', '', '', 7, '', '', '803e3e9c63f01662bc879a2c8a6a9d79_2.webp', 'https://digihostsolutions.com/vivek-nandan-live/uploads/product/803e3e9c63f01662bc879a2c8a6a9d79_2.webp', 1, 1, 2, '2024-03-05 17:25:54', '', '', '', '', '', '', '', 'svp-ngr-scheme-01', 'SVP Ngr Scheme-01', 'Andheri (W)', 'SD Corp', 'Lorem', '', 'Lorem');
