(1, ' What exactly are we falling short of?', 'This can overcome the water crisis\r\nWater is very important in life \'water is life\'. Therefore, proper planning of this essential thing is necessary, if proper planning of water is not done, then a big crisis will arise. Proper planning of rain water is necessary.', '- Akshay Gege, Seawoods, Navi Mumbai.', '73a1af83b22ae558b037da88f962daf9_1.jpg', 'https://localhost/naveshahar/uploads/slider1/73a1af83b22ae558b037da88f962daf9_1.jpg', 1, '2023-07-06 15:11:20', 1, 'Be it season or calamity.. Planning is essential Corona virus infection has wreaked havoc in our city as well as in the entire country of India. Many innocent civilians were killed. Due to the stress on the medical system during the Corona period, there was a large shortage of oxygen beds and vaccines in the second Karuna Lata. It caused a lot of trouble to the citizens.', '5c11c19ab3f7c248c58d4004b9263a7e_1.jpg', 'https://localhost/naveshahar/uploads/slider2/5c11c19ab3f7c248c58d4004b9263a7e_1.jpg', '- System Kamble, Navi Mumbai.');
